import { Spinner } from '@chakra-ui/react';
import React from 'react';
// importing as NodeGraph because React also has Graph and gets confused, causing undefined type in React.createElement
import { Graph as NodeGraph } from 'react-d3-graph';
// data structure definitions for NodeGraph component
interface links {
	source: string;
	target: string;
}
interface nodes {
	id: string;
}
interface nodeGraphDataStruct {
	nodes: nodes[];
	links: links[];
}

function SocialNodeGraph({
	nodeGraphData,
}: {
	nodeGraphData: nodeGraphDataStruct;
}) {
	const myConfig = {
		automaticRearrangeAfterDropNode: false,
		collapsible: false,
		directed: false,
		focusAnimationDuration: 0.75,
		focusZoom: 1,
		freezeAllDragEvents: false,
		height: 400,
		highlightDegree: 1,
		highlightOpacity: 1,
		linkHighlightBehavior: false,
		maxZoom: 8,
		minZoom: 0.1,
		nodeHighlightBehavior: false,
		panAndZoom: false,
		staticGraph: false,
		staticGraphWithDragAndDrop: false,
		width: 800,
		d3: {
			alphaTarget: 0.05,
			gravity: -1000,
			linkLength: 20,
			linkStrength: 1,
			disableLinkForce: false,
		},
		node: {
			color: '#d3d3d3',
			fontColor: 'black',
			fontSize: 8,
			fontWeight: 'normal',
			highlightColor: 'SAME',
			highlightFontSize: 8,
			highlightFontWeight: 'normal',
			highlightStrokeColor: 'SAME',
			highlightStrokeWidth: 'SAME',
			labelProperty: 'id',
			mouseCursor: 'pointer',
			opacity: 1,
			renderLabel: true,
			size: 200,
			strokeColor: 'none',
			strokeWidth: 1.5,
			svg: '',
			symbolType: 'circle',
		},
		link: {
			color: '#d3d3d3',
			fontColor: '#d3d3d3',
			fontSize: 8,
			fontWeight: 'normal',
			highlightColor: 'SAME',
			highlightFontSize: 8,
			highlightFontWeight: 'normal',
			labelProperty: 'label',
			mouseCursor: 'pointer',
			opacity: 1,
			renderLabel: false,
			semanticStrokeWidth: false,
			strokeWidth: 1.5,
			markerHeight: 6,
			markerWidth: 6,
			strokeDasharray: 0,
			strokeDashoffset: 0,
			strokeLinecap: 'butt',
		},
	};

	const onClickNode = function (nodeId) {
		window.alert(`${nodeId} is probably human?`);
	};

	const onClickLink = function (source, target) {
		window.alert(`${source} is friends with ${target}`);
	};

	return (
		<>

				<NodeGraph
					id="socialNetGraph" // id is mandatory
					data={nodeGraphData}
					config={myConfig}
					onClickNode={onClickNode}
					onClickLink={onClickLink}
				/>

		</>
	);
}
export default SocialNodeGraph;
